const mongoose = require('mongoose')
mongoose.connect('mongodb://localhost:27017')
const articleSchema = mongoose.Schema({
  author: {
    type: String,
    require: true,
    trim: true
  },
  title: {
    type: String,
    default: '未命名'
  },
  upDate: {
    type: Date,
    default: Date.now
  },
  content: {
    type: String,
    require: true
  },
  img: String
})
const Article = mongoose.model('Article', articleSchema)
const first = new Article({
  author: 'admin',
  content: '# 第一篇测试文章 ' +
  ' 这个小站会逐渐优化, 目前还不能直接在线添加文章, 我会逐渐修改的, 有设计或者其他放慢的意见可以给我发邮件`hg_limu@163.com` ',
  img: 'data:image/jpeg;base64,'
})
first.save()
mongoose.disconnect()


